import { Tabs, Tab } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";
import PersonOutlinedIcon from "@mui/icons-material/PersonOutlined";
import CalendarTodayOutlinedIcon from "@mui/icons-material/CalendarTodayOutlined";
import HelpOutlineOutlinedIcon from "@mui/icons-material/HelpOutline";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link,
  useLocation,
} from "react-router-dom";

const Topbar = () => {
  const location = useLocation();

  return (
    <Router>
      <Tabs
        defaultActiveKey="/home"
        id="uncontrolled-tab-example"
        className="mb-3"
        activeKey={location.pathname}
      >
        <Tab
          eventKey="/home"
          title={
            <Link
              to="/home"
              className={location.pathname === "/home" ? "active" : ""}
            >
              <HelpOutlineOutlinedIcon style={{ verticalAlign: "middle" }} />
              Main Page
            </Link>
          }
          className="home"
        />
        <Tab
          eventKey="/profile"
          title={
            <Link
              to="/profile"
              className={location.pathname === "/profile" ? "active" : ""}
            >
              <PersonOutlinedIcon style={{ verticalAlign: "middle" }} />
              Profile Page
            </Link>
          }
        />
        <Tab
          eventKey="/contact"
          title={
            <Link
              to="/contact"
              className={location.pathname === "/contact" ? "active" : ""}
            >
              <CalendarTodayOutlinedIcon style={{ verticalAlign: "middle" }} />
              Status Tracker
            </Link>
          }
        />
      </Tabs>

      <Routes>
        <Route path="/home" element={<h1>Home</h1>} />
        <Route path="/profile" element={<div>Profile content here</div>} />
        <Route
          path="/contact"
          element={<div>Contact/Status tracker content here</div>}
        />
      </Routes>
    </Router>
  );
};

export default Topbar;
